import React, { Component } from "react";
import Router from "./Router";

import Layout from "./hoc/Layout/Layout";
import routes from "./Router";

class App extends Component {
  render() {
    return (
      <div>
        <Layout>
					{routes}
          <Router />
        </Layout>
      </div>
    );
  }
}

export default App;
